import React from 'react'
import { Button, View, Text, Image, StyleSheet } from 'react-native'
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import ApiService from '../ApiService'
import { useState, useEffect } from 'react'


interface ProfileScreenProps {
  user: string
}

interface ProfileType {
firstName:string,
lastName:string,
email:string,
password:string,
}

export default function ProfileScreen({user}: ProfileScreenProps) {


  const [profile, setProfile] = useState<ProfileType | undefined>(undefined)


  useEffect(() => {
    ApiService.getUser(user)
    .then(user=> setProfile(user))
  },[],
  )






  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center', backgroundColor: "rgb(20,20,30)", }}>
      <Image style={styles.logo} source={require('../assets/logohq.png')}
      />
      <Button
        title="Create New Arc"
        onPress={() => navigation.navigate('SignUpScreen')}
        />
    <Text style={styles.text}>Welcome Back {(profile)? profile.firstName : 'User 1'}</Text>
    <Text style={styles.text}>Name: {(profile)? profile.firstName + ' ' + profile.lastName: 'User 1'}</Text>
    <Text style={styles.text}>Email:{(profile)? profile.firstName : 'User 1'}</Text>
    {/* <Text style={styles.text}>{(profile)? profile.firstName : 'User 1'}</Text> */}
  </View>

  )
}

const styles = StyleSheet.create({
  logo: {
    width:100,
    height:100,
    top:20,
  },
  button: {
    color:'black'
  },
  container: {
    color:'white'
  },
  text: {
    color:'white'
  }
})
